#include <stdio.h>
#include <stdlib.h>

#include "F16Field.h"

/*
	Write a field element to a char array

	W : writer object
	a : field element to write
*/
void f16serialize_FELT(writer *W, f16FELT a) {
	serialize_uint64_t(W, a , 16);
}

/*
	Read a field element from a char array

	R : reader object

	returns : a field element
*/
f16FELT f16deserialize_FELT(reader *R) {
	return ((f16FELT) deserialize_uint64_t(R,16));
}

/*
	prints a field element, mainly used for debugging
*/
void f16printFELT(f16FELT a) {
	/* printf("%.5u ", a); */
	if(a==0){
		printf(".");
	}
	else{
		printf("X");
	}
}

/*
	Multiplies two field elements

	a,b : field element to multiply

	return : the product of a and b
*/
f16FELT f16multiply(f16FELT a, f16FELT b) {
	if (a == 0 || b == 0)
		return 0;
	return f16antilog((f16log(a) + f16log(b)) % f16units);
}

/*
	Inverts a field element

	a : field element to invert

	return : the inverse of a, if a is nonzero
*/
f16FELT f16inverse(f16FELT a) {
	return f16antilog((f16units - f16log(a)) % f16units);
}

/*
 * Stuff concerning polynomials over F_2^16 , all polynomials are represented by arrays of length 6 because we will only use polynomials of degree up to 5
 */

/*
	The euclidean division algorithm. 
	Given polynomials a and b it calculates the quotient q and remainder r such that
	deg(r) < deg(b) and a = q*b + r 

	a,b : two polynomials over F_2^16
	q : quotient
	r : remainder
*/
void f16EucildeanDivision(f16FELT *a, f16FELT *b, f16FELT *q, f16FELT *r) {
	int i,j;
	f16FELT LCBinv;
	int degB = 0;
	for (i = 0; i < 6; i++) {
		if (b[i] != 0)
			degB = i;
		q[i] = 0;
		r[i] = a[i];
	}

	LCBinv = f16inverse(b[degB]);

	for (i = 5; i >= degB; i--) {
		if (r[i] == 0)
			continue;

		q[i - degB] = f16multiply(LCBinv, r[i]);
		r[i] = 0;
		for (j = 0; j < degB; j++) {
			r[j + i - degB] ^= f16multiply(q[i - degB], b[j]);
		}
	}

	return;
}

/*
	Checks if a is the zero polynomial
*/
int isArrayOfZeros(f16FELT *a) {
	int i;
	for (i = 0; i < 6; i++) {
		if (a[i] != 0)
			return 0;
	}
	return 1;
}

/*
	Multiplies two polynomials over F_2^16

	a,b : two polynomials
	ans : is set to a*b mod (X^6)
*/
void f16polyMult(f16FELT *a, f16FELT *b, f16FELT *ans) {
	int i,j;
	for (i = 0; i < 6; i++) {
		ans[i] = 0;
		for (j = 0; j <= i; j++) {
			ans[i] ^= f16multiply(a[j], b[i - j]);
		}
	}
}

/*
	Adds two polynomials over F_2^16

	a,b : two polynomials
	ans : is set to a+b
*/
void f16polyAdd(f16FELT *a, f16FELT *b, f16FELT *ans) {
	int i;
	for (i = 0; i < 6; i++) {
		ans[i] = f16add(a[i], b[i]);
	}
}

/*
	Sets a polynomial to the zero polynomial
*/
void f16polyZero(f16FELT *a) {
	int i;
	for (i = 0; i < 6; i++) {
		a[i] = 0;
	}
}

/*
	Sets a polynomial to the identity
*/
void f16polyOne(f16FELT *a) {
	int i;
	a[0] = 1;
	for (i = 1; i < 6; i++) {
		a[i] = 0;
	}
}

/*
	Copies a polynomial

	a : a polynomial to copy
	copy : is set to a 
*/
void f16polyCopy(const f16FELT *a, f16FELT *copy) {
	int i;
	for (i = 0; i < 6; i++) {
		copy[i] = a[i];
	}
}

/*
Scalar multiplication

	a : an element in the field, which is muliplied by 2^b
	b : an integer
*/
void f16scalarMultiply(f16FELT *a, uint16_t b) {
	if (*a != 0) {
		*a = f16antilog((f16log(*a) + b) % f16units);
	}
}

/*
	Extended Euclidean Algorithm
	given two polynomials a and b it calculates the greatest common divisor, as well as polynomials x and y such that
	x*a + y*b = gcd
*/
void f16ExtendedEuclideanAlgorithm(f16FELT *a, const f16FELT *b, f16FELT *x, f16FELT *y, f16FELT *gcd) {
	f16FELT q[6], r[6], A[6], B[6], u[6], v[6], m[6], n[6];

	f16polyCopy(a, A);
	f16polyCopy(b, B);

	f16polyZero(x);
	f16polyOne(y);

	f16polyOne(u);
	f16polyZero(v);

	while (!isArrayOfZeros(A))
	{
		f16FELT uq[6];
		f16FELT vq[6];

		f16EucildeanDivision(B, A, q, r);
		
		f16polyMult(u, q, uq);
		f16polyAdd(x, uq, m);
		
		f16polyMult(v, q, vq);
		f16polyAdd(y, vq, n);

		f16polyCopy(A, B);
		f16polyCopy(r, A);

		f16polyCopy(u, x);
		f16polyCopy(v, y);

		f16polyCopy(m, u);
		f16polyCopy(n, v);
	}
	f16polyCopy(B, gcd);
}

